import logo from "./logo.svg";
import "./Footer.scss";

function Footer() {
  return (
    <div className="Footer">
      <footer className="footer-style">
        <div className="links">
          <p>Home</p>
          <p>Home</p>
          <p>Home</p>
        </div>
        <img src={logo} className="logo" alt="logo" />
      </footer>
    </div>
  );
}

export default Footer;
